import React from "react";
import { parseISO, formatDistanceToNow } from "date-fns";

export const TimeAgo = ({timestamp}) => {
    let timeAgo = '';
    if(timeAgo){
        const date = parseISO(timestamp);
        const timePeriod = formatDistanceToNow(date);
        timeAgo = `${timePeriod} ago`;
    }

    return (
        <span title="{timeAgo}">
            &nbsp; <i>{timeAgo}</i>
        </span>
    );
}
